import React from 'react'
import { Avatar } from '@mui/material'

interface Props {
  alt?: string
  image: string
  sx?: any
}

export default function Icon({ image, alt, ...sx }: Props): JSX.Element {
  return (
    <Grid item xs={12} sx={{ margin: '10px auto' }}>
      <Icon
        image='app/assets/images/logo.png'
      />
    </Grid>

  )
}
